// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    mapping(address => bool) public hasVoted;
    mapping(address => string) public voterChoices;  // Track which candidate each voter voted for
    mapping(string => uint256) public voteCounts;
    address public admin;
    bool public isInitialized;
    bool public electionEnded;
    bool public testMode;
    
    event VoteCast(address indexed voter, string candidateName);
    event VoteReset(address indexed voter, string candidateName);
    event AllVotesReset();
    
    constructor() {
        admin = msg.sender;
        isInitialized = true;
        electionEnded = false;
        testMode = true; // Set to true for testing
    }
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    function vote(string memory _candidateName) public {
        require(!electionEnded || testMode, "Election has ended");
        require(!hasVoted[msg.sender] || testMode, "Already voted");
        
        if (testMode && hasVoted[msg.sender]) {
            // If voter has previously voted in test mode, remove their previous vote
            string memory previousVote = voterChoices[msg.sender];
            if (bytes(previousVote).length != 0) {
                voteCounts[previousVote]--;
            }
        }
        
        hasVoted[msg.sender] = true;
        voterChoices[msg.sender] = _candidateName;
        voteCounts[_candidateName]++;
        emit VoteCast(msg.sender, _candidateName);
    }
    
    function getVoteCount(string memory _candidateName) public view returns (uint256) {
        return voteCounts[_candidateName];
    }
    
    // Reset function for testing
    function resetVotingState(address voter) public onlyAdmin {
        require(testMode, "Can only reset votes in test mode");
        if (hasVoted[voter]) {
            string memory candidateName = voterChoices[voter];
            if (bytes(candidateName).length != 0) {
                voteCounts[candidateName]--;
                emit VoteReset(voter, candidateName);
            }
        }
        hasVoted[voter] = false;
        delete voterChoices[voter];
    }
    
    // Reset all vote counts for testing
    function resetAllVotes() public onlyAdmin {
        require(testMode, "Can only reset votes in test mode");
        electionEnded = false;
        emit AllVotesReset();
    }
    
    function toggleTestMode() public onlyAdmin {
        testMode = !testMode;
    }
    
    function endElection() public onlyAdmin {
        electionEnded = true;
    }
    
    function isElectionEnded() public view returns (bool) {
        return electionEnded && !testMode;
    }
}
